import React from "react";
import ReactDOM from "react-dom";
import Highcharts, { color } from 'highcharts';
import HighchartsReact from "highcharts-react-official";
import HighChartsMore from "highcharts/highcharts-more";
import item from "highcharts/modules/item-series"
function SoftChart() {
    HighChartsMore(Highcharts)
    item(Highcharts)
    let options= {
        legend: {
            enabled:true,
            itemStyle:
            {
                color: "#d4d2d2"
            }
        },
        chart: {
            type: 'item',
            height:"350px",
            backgroundColor:'transparent'
        },
        plotOptions: {
            item: {
                dataLabels:
            {
                enabled:false
            }
            }
            
        },
        tooltip:{enabled:false},
        series: [{
            name: '',
            keys: ['name', 'y', 'color'],
            data: [
              ['Swimming', 120, '#BE3075'],
              ['Table Tennis', 100, '#EB001F'],
              ['DJ-ing', 90, '#64A12D'],
              ['Weightlifting', 100, '#FFED00'],
              ['Public Speaking', 70, '#000000'],
              ['Problem Solving', 150, '#008AC5'],
              ['Work Ethic', 94, '#009EE0']
            ],
            center: ['50%', '50%'],
            size: '85%',
            startAngle: 0,
            endAngle: 360
        }],
        title: {
            style:{color:'transparent',fontSize:'0px',fontFamily:'cursive'},
            text: '(Click on each section for more info)'
            },
    credits: {
        enabled:false
        }
    }
    return (
    <span>
        <HighchartsReact 
            highcharts={Highcharts}
            options={options}
        />
    </span>
    )
}

export default SoftChart;
